description:
British Female Director, Anjali Kara documents the lifestyles of five, wealthy housewives who devote themselves to sexual adventure and personal satisfaction
As members of The Trophy Wives Club they make a pact to share their sexual conquests within their own private inner circle
Cuckold husbands, swingers, young lovers and group sex experiences are the norm for this elite group of friends
A tale of pure sexual indulgence featuring a stunning cast of fine British Trophy Wives brought to you by Anjali Kara.

Summer Rose, Valerie Fox, Marc Rose, Tia Layne, Louise Jenson, Kai Taylor, Rio Lee

